      // Function to remove duplicate URLs from an array
      function removeDuplicateURLs(array) {
        var uniqueURLs = [];
        for (var i = 0; i < array.length; i++) {
          if (uniqueURLs.indexOf(array[i]) === -1) {
            uniqueURLs.push(array[i]);
          }
        }
        return uniqueURLs;
      }

      // Remove duplicate URLs from the array
      var uniqueURLsArray = removeDuplicateURLs(urls);

      // Display the unique URLs
      var uniqueURLsList = document.createElement("ul");
      for (var j = 0; j < uniqueURLsArray.length; j++) {
        var listItem = document.createElement("li");
        listItem.textContent = uniqueURLsArray[j];
        uniqueURLsList.appendChild(listItem);
      }
